from random import randrange
from time import sleep

LIGNES_TRANS = 25

def lignesTrans(nbLignes):
    ligne = ''
    for i in range(0, 49):
        temp = randrange(10)
        ligne += str(temp) + ' '
    return ligne

def transition():
    print('\n' * 5)
    for i in range(0, LIGNES_TRANS):
        print(lignesTrans(LIGNES_TRANS))
        print()
        sleep(0.03)
    print('\n' * 5)

